URL='http://www.gcmap.com/airport/'

def GetInfoByIATA(code):
    try:
        r=session.get(URL+code, headers=headers)
    except:
        exit()
    q=r.html
    t=q.find('table')[2].text
    t=t.split('\n')
    t.pop(0)
    cnt = 10
    l1=list()
    l2=list()
    l1=t[::2]
    l2=t[1::2]
    d=dict()
    for i in range(10):
        d[l1[i][:-1]] = l2[i]

    return d


